import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';
import './assets/css/App.css'

function App() {
  return (
    <div>
      <h1>Hello, World!</h1>
      <Button className="mt-5" variant="primary">Click Me</Button>
    </div>
  );
}

export default App;
